              for (i = 0; i < 35; ++i)
                buffer_out[c] += buffer_in[i] * kernel_4[i][c];

            norma = 0;

            // Prepares for next layer 
            for (c = 0; c < 35; ++c )
              buffer_in[c] = activation_4(buffer_out[c], norma);


            
  // Processing layer 5 

            for (c = 0; c < 35; ++c ) 
              buffer_out[c] = bias_5[c];

            for (c = 0; c < 35; ++c )
              for (i = 0; i < 35; ++i)
                buffer_out[c] += buffer_in[i] * kernel_5[i][c];

            norma = 0;

            // Prepares for next layer 
            for (c = 0; c < 35; ++c )
              buffer_in[c] = activation_5(buffer_out[c], norma);


            
  // Processing layer 6 

            for (c = 0; c < 3; ++c ) 
              buffer_out[c] = bias_6[c];

            for (c = 0; c < 3; ++c )
              for (i = 0; i < 35; ++i)
                buffer_out[c] += buffer_in[i] * kernel_6[i][c];

            norma = 0;

            for(c=0;c<3;++c)
              norma+=exp(buffer_out[c]);

            // Prepares for next layer 
            for (c = 0; c < 3; ++c )
              buffer_in[c] = activation_6(buffer_out[c], norma);


            

      //i = 0;
