      //  if (buffer_in[c] > buffer_in[i])
      //    i = c;
      
      if (flag==0) //vbf
        return buffer_in[0];
      else if (flag==1) //ggh
        return buffer_in[1];
      else if (flag==2)  //bkg
        return buffer_in[2];
   
      
